import students from "../assets/data/student.json";

const Tablo = () => {

const still={
color:"crimson",
fontWeight:"bolder",
backgroundColor:"aquamarine"

}





  return (
    <div>
      Tablo
      <h1>KURSIYERLER</h1>
      <table>
        <thead>
          <tr>
            <th>ISIM</th>
            <th>YAS</th>
            <th>KURSU</th>
          </tr>
        </thead>
        <tbody>
          {students.map((student, index) => {
            return (
              <tr key={index}>
                <td>{index}-{student.isim}</td>
                <td>{student.yas}</td>
                <td>{student.kurs}</td>
              </tr>
            );
          })}
        </tbody>
      
      </table>
    </div>
  );
};

export default Tablo;
